import React from "react";
import logo from '../images/Logos-light/Logo-standalone-default-full-colour@1x.svg'


const MB = () => {
    return(
        <div className='head2'>
            <img src={logo} className="App-logo" alt="logo" sx ={{ height:'94px', width:'375.06px' }}/>
            <h1 className="map-all-build-details"> MapAll Build Details </h1> 
        </div>
    );
}

export default MB;
